import './App.css';
import {Container, Jumbotron} from "react-bootstrap";
import AppHeader from "./components/AppHeader";

function App() {
    return (
        <>
            <AppHeader/>
            <Container fluid='md'>
                <Jumbotron>
                    <h1 className="header">Welcome To React-Bootstrap</h1>
                </Jumbotron>
            </Container>
        </>
    );
}

export default App;
